INSERT INTO `field_data_body` VALUES ('node','person',0,1,1,'und',0,'Billie Joe Armstrong (born February 17, 1972)[1] is an American musician, singer, songwriter and actor who is best known as the lead vocalist, primary songwriter, and guitarist of the pop punk rock band Green Day, which he co-founded with Mike Dirnt. He is also a guitarist and vocalist for the punk rock band Pinhead Gunpowder and provides lead vocals for Green Day\'s side projects Foxboro Hot Tubs and The Network.','','filtered_html'),('node','person',0,2,2,'und',0,'Michael Ryan Pritchard[1] (born May 4, 1972),[1] known professionally as Mike Dirnt, is an American musician best known for being the co-founder, bassist, backing and occasional lead vocalist of the American punk rock band Green Day. He has also played in several other bands, including The Frustrators. His stage name was originally a nickname from his friends at grade school, as he would constantly play \"air bass\" and make a \"dirnt, dirnt, dirnt\" noise while pretending to pluck the strings.','','filtered_html'),('node','person',0,3,3,'und',0,'Frank Edwin Wright III (born December 9, 1972), known professionally as Tré Cool, is a German-born American drummer, best known as the drummer for the American punk rock/pop punk band Green Day. He replaced the band\'s former drummer John Kiffmeyer in 1990. Cool has also played in The Lookouts, Samiam and the Green Day side-projects The Network and the Foxboro Hot Tubs.','','filtered_html'),('node','person',0,4,4,'und',0,'Jason White (born November 11, 1973) is an American musician best known as the current touring guitarist for the American punk rock bandGreen Day. He played as a touring member of Green Day from 1999 until 2012, when he became an official member of the band, However in 2016 he was demoted back to being a touring member. He is also the guitarist and vocalist for the Californian punk band Pinhead Gunpowder, and co-founder of Adeline Records alongside Billie Joe Armstrong.','','filtered_html'),('node','band',0,5,5,'und',0,'Green Day is an American punk rock band formed in 1986 by vocalist/guitarist Billie Joe Armstrong and bassist Mike Dirnt. For much of the group\'s career, the band has been a trio with drummer Tré Cool, who replaced former drummer John Kiffmeyer in 1990 prior to the recording of the band\'s second studio album, Kerplunk (1992). In 2012, guitarist Jason White became an official member after having performed with the band as a touring member since 1999,[1] before returning to his role as a touring member in 2016.[2]','','filtered_html'),('node','record_label',0,6,6,'und',0,'Adeline Records is a record label which was formed in Oakland, California in late 1997. It was created by Billie Joe Armstrong, lead singer of Green Day, Screw 32\'s Doug Sangalang, Green Day guitarist Jason White and professional skateboarder Jim Thiebaud.[1][2] Green Day\'s management company, Pat Magnarella Management, now owns the label. Adeline Records was named after a street (Adeline Street) that runs from The Port of Oakland through West Oakland and NOBE, terminating at Ward St and Shattuck Ave in Berkeley.[3]','','filtered_html'),('node','album',0,7,7,'und',0,'Dookie is the third studio album by the American punk rock band Green Day, released on February 1, 1994, through Reprise Records.[1] It was the band\'s first collaboration with producer Rob Cavallo and its major record label debut. Dookie became a worldwide commercial success, peaking at No. 2 on the US Billboard 200 and charting in seven countries.[2][3] The album helped propel Green Day, and even punk rock music into mainstream popularity.[4] Dookie was certified Diamond by the Recording Industry Association of America for the shipment of 10 million copies.','','filtered_html'),('node','album',0,8,8,'und',0,'Ad dolus jumentum usitas validus volutpat. At dignissim macto nostrud patria praemitto quidem. Ad adipiscing iusto lucidus similis singularis ulciscor uxor.\n\nAdipiscing at caecus p