INSERT INTO `field_data_field_lyrics` VALUES ('file','song',0,1,1,'und',0,'\"Basket Case\"\r\n\r\nDo you have the time\r\nTo listen to me whine\r\nAbout nothing and everything\r\nAll at once\r\nI am one of those\r\nMelodramatic fools\r\nNeurotic to the bone\r\nNo doubt about it\r\n\r\nSometimes I give myself the creeps\r\nSometimes my mind plays tricks on me\r\nIt all keeps adding up\r\nI think I\'m cracking up\r\nAm I just paranoid?\r\nAm I just stoned?\r\n\r\nI went to a shrink\r\nTo analyze my dreams\r\nShe says it\'s lack of sex\r\nThat\'s bringing me down\r\nI went to a whore\r\nHe said my life\'s a bore\r\nSo quit my whining cause\r\nIt\'s bringing her down\r\n\r\nSometimes I give myself the creeps\r\nSometimes my mind plays tricks on me\r\nIt all keeps adding up\r\nI think I\'m cracking up\r\nAm I just paranoid?\r\nUh, yuh, yuh, ya\r\n\r\nGrasping to control\r\nSo I better hold on\r\n\r\nSometimes I give myself the creeps\r\nSometimes my mind plays tricks on me\r\nIt all keeps adding up\r\nI think I\'m cracking up\r\nAm I just paranoid?\r\nAm I just stoned?\r\n',NULL),('file','song',0,2,2,'und',0,'\"Longview\"\r\n\r\nSit around and watch the tube, but nothing\'s on\r\nI change the channels for an hour or two\r\nTwiddle my thumbs just for a bit\r\nI\'m sick of all the same old shit\r\nIn a house with unlocked doors\r\nAnd I\'m fucking lazy\r\n\r\nBite my lip and close my eyes\r\nTake me away to paradise\r\nI\'m so damn bored I\'m going blind\r\nAnd I smell like shit\r\n\r\nPeel me off this Velcro seat and get me moving\r\nI sure as hell can\'t do it by myself\r\nI\'m feeling like a dog in heat\r\nBarred indoors from the summer street\r\nI locked the door to my own cell\r\nAnd I lost the key\r\n\r\nBite my lip and close my eyes\r\nTake me away to paradise\r\nI\'m so damn bored I\'m going blind\r\nAnd I smell like shit\r\n\r\nI got no motivation\r\nWhere is my motivation?\r\nNo time for the motivation\r\nSmoking my inspiration\r\n\r\nSit around and watch the phone, but no one\'s calling\r\nCall me pathetic, call me what you will\r\nMy mother says to get a job\r\nBut she don\'t like the one she\'s got\r\nWhen masturbation\'s lost its fun\r\nYou\'re fucking lonely\r\n\r\nBite my lip and close my eyes\r\nTake me away to paradise\r\nI\'m so damn bored\r\nI\'m going blind\r\nAnd loneliness has to suffice\r\nBite my lip and close my eyes\r\nI was slipping away to paradise\r\nSome say, \"Quit or I\'ll go blind.\"\r\nBut it\'s just a myth',NULL),('file','song',0,3,3,'und',0,'\"When I Come Around\"\r\n\r\nI heard you crying loud,\r\nAll the way across town\r\nYou\'ve been searching for that someone,\r\nAnd it\'s me out on the prowl\r\nAs you sit around feeling sorry for yourself\r\n\r\nWell, don\'t get lonely now\r\nAnd dry your whining eyes\r\nI\'m just roaming for the moment\r\nSleazin\' my back yard so don\'t get so uptight\r\nYou been thinking about ditching me\r\n\r\nNo time to search the world around\r\nCause you know where I\'ll be found\r\nWhen I come around\r\n\r\nI heard it all before\r\nSo don\'t knock down my door\r\nI\'m a loser and a user so I don\'t need no accuser\r\nTo try and slag me down because I know you\'re right\r\nSo go do what you like\r\nMake sure you do it wise\r\nYou may find out that your self-doubt means nothing\r\nWas ever there\r\n\r\nYou can\'t go forcing something if it\'s just\r\nNot right\r\n\r\nNo time to search the world around\r\nCause you know where I\'ll be found\r\nWhen I come around\r\n\r\nNo time to search the world around\r\nCause you know where I\'ll be found\r\nWhen I come around\r\nWhen I come around\r\nWhen I come around\r\nWhen I come around',NULL);
